import React from 'react';

import styled from 'styled-components'


const Box =styled.div`
position: absolute;
left: 50%;
top: 50%;
transform: translate(-50%, -50%);


width: 65vw;
height:55vh;
display: flex;
`

const Intro = () => {
    return (
        <Box>
            Introduction
        </Box>
    );
};

export default Intro;
